// src/components/Skills.js
import React from 'react';

const Skills = () => {
    return (
        <div className="skills">
            <h2>Skills</h2>
            <ul>
                <li>Analytics</li>
                <li>Amazon Web Services (AWS)</li>
                <li>Data Analytics</li>
                <li>Data Science</li>
            </ul>
        </div>
    );
};

export default Skills;
